    gmt set PS_MEDIA 8.5ix11i

    PSFILE="test_ff2gmt.ps"

    PROJ="-JM5i -P"
    LIMS="-R-72/-69/-22/-18"

    gmt makecpt -T0/10/0.1 -Cmagma -D -I > slip.cpt || exit 1
    echo 0 0 | gmt psxy $PROJ $LIMS -K > $PSFILE || exit 1

